import classes from './Card.module.css';

const Card = props => {
  const [isHovered, setIsHovered] = useState(false);

  const handleHover = () => {
    setIsHovered(true);
  };

  const handleLeave = () => {
    setIsHovered(false);
  };

  return <div className={classes.card}>{props.children}</div>
};

export default Card;
